import { Children } from "react";

export const NavList = [
  {
    name: "Products and services",
    Children: [
      {
        Title: "WeChat Store Mail Version",
        name: "A private domain shopping mail with high cost performance",
      },
      {
        Title: "WeChat Store Distribution",
        name: "Flexible and rich distribution tools to quickly expand business",
      },
      {
        Title: "One-Click Store Relocation",
        name: "Goods, Members point and customer are quickly moved to Webchat store",
      },
    ],
  },
  {
    name: "Solution",
    Children: [],
  },
  {
    name: "Player Community",
    Children: [],
  },
  {
    name: "Weidian Academy",
  },
  {
    name: "Weidian Cloud",
  },
  {
    name: "Business Cooperation",
  },
  {
    name: "Help Center",
  },
];
